// charts/BasicD3.js
import * as d3 from "d3";

export function drawChart(height, width) {
  const svg = d3
    .select("#chart")
    .append("svg")
    .attr("width", width)
    .attr("height", height)
    .style("border", "1px solid black");

  var selection = svg.selectAll("rect").data(data);
}
